# -*- encoding: utf-8 -*-
"""
Using data typical of supermarkets, superstores and online aunctions this
collection is perfect for creating test data for ecommerce applications. It
might also be useful for teachers in class room activities. Products are
classified as Grocery, Superstore or Auction, and also contain a sub category
(bathroom, computing, dry goods, etc). NB: I have also kept the orginal price
in place to help with the realistic feel to the fake data, but it would be just
as easy to use the Primitive data class to do this.

**Usage:**

::

    from liar.iamaliar import IAmALiar
    number_records = 10
    maker = IAmALiar(number_records)

    # Use:
    from liar.model.raw import product_raw

    # Or from scratch:
    product_raw = {
        'name': 'product_raw',
        'class': 'igetraw',
        'data': 'product',
    }

    data_set = maker.get_data([product_raw])

    for row in data_set:
        data = Model()
        product.product = row['product_raw']['product']
        product.classification = row['product_raw']['classification']
        product.category = row['product_raw']['category']
        product.price = row['product_raw']['price']
        data.save()

Create a definition which only gets the product_name, using the
property option:

::

    product_name_raw = {
        'name': 'product_name_raw',
        'class': 'igetraw',
        'data': 'product',
        'property': 'product',
    }

    data_set = maker.get_data([product_name_raw])

    for row in data_set:
        data = Model()
        data.product_name = row['product_name_raw']
        data.save()

"""

